tables.table_schema:
CREATE TABLE program_impact (
    program_id INT PRIMARY KEY,
    program_name VARCHAR(255) NOT NULL,
    awareness_score INT,
    advocacy_score INT
);

CREATE TABLE participant_details (
    participant_id INT PRIMARY KEY,
    participant_name VARCHAR(255) NOT NULL,
    program_id INT,
    CONSTRAINT fk_program_id FOREIGN KEY (program_id) REFERENCES program_impact(program_id)
);

CREATE TABLE program (
 program_id UUID PRIMARY KEY,
 program_name VARCHAR(255),
 start_date DATE,
 end_date DATE
);

CREATE TABLE resource (
 resource_id UUID PRIMARY KEY,
 resource_name VARCHAR(255),
 resource_type VARCHAR(50),
 impact_measurement_id UUID REFERENCES impact_measurement(measurement_id)
);

CREATE TABLE feedback (
 feedback_id UUID PRIMARY KEY,
 feedback_text TEXT,
 feedback_date DATE,
 participant_id UUID REFERENCES participant(participant_id)
);
